import React from 'react';
import './register.css';
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBBtn,
  MDBIcon,
  MDBInput,
  MDBCheckbox
}
from 'mdb-react-ui-kit';

function App() {
  return (
    <MDBContainer fluid className="p-3 my-5">

      <MDBRow className='mb-3'>
      <MDBCol sm='5' offsetMd='6'>
      <MDBInput wrapperClass='mb-4' label='Username' id='formControlLg' type='email' size="lg"/>
        </MDBCol>
        <MDBCol sm='5' offsetSm='2' md='6' offsetMd='0'>
        <MDBInput wrapperClass='mb-4' label='address' id='formControlLg' type='password' size="lg"/>
        </MDBCol>
        <MDBCol col='10' md='6'>
          <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.svg" class="img-fluid" alt="Phone image" />
        </MDBCol>
        <div className="d-flex justify-content-between mx-4 mb-4">
            <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label='Remember me' />
            <a href="!#">Forgot password?</a>
          </div>

          <MDBBtn className="mb-4 w-100" size="lg">Sign Up</MDBBtn>
        {/* <MDBCol col='1' md='6'>


          <MDBInput wrapperClass='mb-4' label='Username' id='formControlLg' type='email' size="lg"/>
          <MDBInput wrapperClass='mb-4' label='address' id='formControlLg' type='password' size="lg"/>
          


          
          </MDBCol> */}
    



          



      </MDBRow>

    </MDBContainer>
  );
}




export default App;
